fontArial24hb = 

    dw  0bfcah	 ; magic number = 0xBFCA, created by BitFontCreator 
    dw  0320h	 ; version: 0x0100 for version 1.00, 0x0210 for 2.10 
    dw  0045h	 ; font flags =  | FONT_FLAG_BW | FONT_FLAG_ASCII
    dw  24   	 ; font width in pixels. 0 for variable width font 
    dw  24   	 ; font height in pixels 
    dw  23   	 ; font ascent (baseline) in pixels 

    dw  0020h	 ; first character code defined in font 
    dw  00ffh	 ; last character code defined in font 
    dw  192  	 ; # characters in font, maybe not equal to (lastchar-firstchar+1) 

    db  0		 ; 1 byte reserved, not used 

    db  1    	 ; 1, 2, 4 bytes per unit in imagebits data table, see data length when export font data 
    dd  3600h	 ; # bytes/words/dwords(based bitsPerUnit) imagebits data in data table 
    ;   (UCHAR *)fontArial24hb_data_table, 	 ;pointer to the imagebits data table

